-- ----------------------------
-- Procedure structure for create_calendar
-- ----------------------------
DROP PROCEDURE IF EXISTS `create_calendar`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `create_calendar`(s_date DATE, e_date DATE)
BEGIN

	SET @createSql = 'CREATE TABLE IF NOT EXISTS calendar (
                      `date` date NOT NULL,
		       UNIQUE KEY `unique_date` (`date`) USING BTREE
                   )ENGINE=InnoDB DEFAULT CHARSET=utf8'; 
	prepare stmt from @createSql; 
	execute stmt; 
 
	WHILE s_date <= e_date DO
		SET s_date = s_date + INTERVAL 1 DAY ;
	END WHILE ; 
 
END
;;
DELIMITER ;
